import React from "react";
import Slider from "react-slick";
import "Users/kane/Sonnenhus/sonnenhus/node_modules/slick-carousel/slick-theme.css";
import "Users/kane/Sonnenhus/sonnenhus/node_modules/slick-carousel/slick.css";
import "./slideshow.css";

const Slideshow = ({images}) => { 
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 2000,
        pauseOnHover: true,
        cssEase: "linear",
    };
    return (
        <div className="slideshow">
        <Slider {...settings}>
            {images.map((image, index) => (
                <div key={index}>
                    <img src={image} alt="Slideshow" className="slideshow_image" />
                </div>
            ))}
        </Slider>
        </div>
    );
}
export default Slideshow;
